window.addEventListener('load', function(){
  console.log("init conv test 19");
  var currentPageTitle = document.querySelector('.summary-banner h1').innerHTML.replace(/\s+/g, '');
  var foundData = data.filter(function(x) { return(x.name.replace(/\s+/g, '') === currentPageTitle); });
  var hospFactUrl = document.querySelector('a.btn[title="Hospital Fact Sheet"]');
  hospFactUrl = hospFactUrl ? hospFactUrl : document.querySelector('.icon-card--hospital a.btn[title="Package Fact Sheet"]');
  var exFactUrl = document.querySelector('a.btn[title="Extras Fact Sheet"]');
  exFactUrl = exFactUrl ? exFactUrl : document.querySelector('.icon-card--extra a.btn[title="Package Fact Sheet"]');

  if(foundData.length > 0){
    var content = foundData[0];
    var el = document.getElementById('conv-test-19');
    var iconHospitalEl = el.querySelector('.product-tier--hospital');
    var iconExtrasEl = el.querySelector('.product-tier--extras');	
    var benefitsEl = el.querySelector('.cover-type__benefits');   

    // toggle level display
    if(content.hospital !== 0 ){
      el.querySelector('.product-tier--hospital').parentNode.classList.remove('d-none');
    }    
    if(content.extras !== 0 ){
      el.querySelector('.product-tier--extras').parentNode.classList.remove('d-none');
    }

    // populate data
    iconHospitalEl.querySelector('.product-tier__level').innerHTML = content.hospital_label;
    iconExtrasEl.querySelector('.product-tier__level').innerHTML = content.extras_label;

    switch(content.hospital){
      case 1:
        iconHospitalEl.querySelector('.product-tier__icon').innerHTML = hospIcon1;
        break;
      case 2:
        iconHospitalEl.querySelector('.product-tier__icon').innerHTML = hospIcon2;
        break;
      case 3:
        iconHospitalEl.querySelector('.product-tier__icon').innerHTML = hospIcon3;
        break;
      default:
        break;
    }

    switch(content.extras){
      case 1:
        iconExtrasEl.querySelector('.product-tier__icon').innerHTML = exIcon1;
        break;
      case 2:
        iconExtrasEl.querySelector('.product-tier__icon').innerHTML = exIcon2;
        break;
      case 3:
        iconExtrasEl.querySelector('.product-tier__icon').innerHTML = exIcon3;
        break;
      default:
        break;
    }

    content.list.forEach(function(item){
      benefitsEl.innerHTML += '<div class="cover-type__benefit-item">' + checkIcon + ' ' + item + '</div>';
    });   
  } else {
    if(document.querySelector('.icon-card.icon-card--hospital')){document.querySelector('.icon-card.icon-card--hospital').classList.add('show'); }
    if(document.querySelector('.icon-card.icon-card--extra')){ document.querySelector('.icon-card.icon-card--extra').classList.add('show');}
  }

  if(hospFactUrl && foundData.length > 0){
    var hospurl = hospFactUrl.getAttribute('href');
    var hosptargetEl = document.getElementById('conv-test-19-hospital-link');
    hosptargetEl.classList.remove('d-none');
    hosptargetEl.setAttribute('href', hospurl);
  }

  if(exFactUrl && foundData.length > 0){
    var exurl = exFactUrl.getAttribute('href');
    var extargetEl = document.getElementById('conv-test-19-extras-link');
    extargetEl.classList.remove('d-none');
    extargetEl.setAttribute('href', exurl);
  }

});
