const phiHomeQuoteTool = () => {
    const parent = document.querySelector('.conv-test-57--quote-tool-col__cover-needs-location');
    if (!parent) { return; }

    // skip if no questions loaded
    const question1 = parent.querySelector('.ex-dep-1');
    const question2 = parent.querySelector('.ex-dep-2');
    if(!question1){ return; }
    if(!question2){ return; }

    const typeSelect = parent.querySelector('#typeSelect');
    let typeSelectValue = typeSelect.value;
    let question1Value = question1.querySelector('[name="DependentFirstQuestion"]:checked').value;

    const resetExDepQuestions = () => {
        question1.classList.add('d-none');
        question2.classList.add('d-none');
        question2.classList.remove('show');
        question2.querySelectorAll('label').forEach(q => q.setAttribute('tabindex', '-1'));
    };

    const initQuestions = (value) => {
        if (value.includes('Family') || value.includes('SingleParent')) {
            question1.classList.remove('d-none');
            question2.classList.remove('d-none');

            if (question1Value === 'No') {
                question2.classList.add('show');
                question2.querySelectorAll('label').forEach(q => q.setAttribute('tabindex', '0'));
            } else {
                question2.classList.remove('show');
                question2.querySelectorAll('label').forEach(q => q.setAttribute('tabindex', '-1'));
            }
        } else {
            resetExDepQuestions();
        }
    };

    initQuestions(typeSelectValue);

    typeSelect.addEventListener('change', e => {
        typeSelectValue = e.target.value;
        initQuestions(typeSelectValue);
    });

    question1.addEventListener('change', e => {
        question1Value = e.target.value;
        initQuestions(typeSelectValue);
    });

};
