const optProductsMapObj = {
"Care 'n' Repair (Basic Plus)": "Low Extras",
"Starter Classic Combination (Bronze Plus)": "Medium Extras",
"Advantage Choice Combination (Silver Plus)": "Medium Extras",
"Top Choice (Silver Plus)": "Medium Extras",
"Base Extras": "Low Extras",
"Mid Extras": "Medium Extras",
"Active Extras": "Medium Extras",
"Prime Extras": "High Extras",
};

function optUpdateFrequencyLabels() {
  //console.log('test');
	const optFrequencyList = document.querySelectorAll('.frequency-select');
  const optFrequencyListArr = [...optFrequencyList];
  optFrequencyListArr.forEach(frequencyList => {
    const optFrequencyItems = frequencyList.querySelectorAll('.dropdown-item');
  	const optFrequencyItemsArr = [...optFrequencyItems];
    optFrequencyItemsArr.forEach(frequencyItem => {  
       const currentLabel =  frequencyItem.innerHTML;
       if(!currentLabel.includes("payment")) {
       	frequencyItem.innerHTML = currentLabel + " payment";
       }
       if(frequencyItem.classList.contains("active")){
         const currentButton = frequencyList.parentNode.querySelector(".dropdown-toggle");
       	 currentButton.innerHTML = frequencyItem.innerHTML;
       }
    });
  });
}

function optAddDynamicLabels() {
  //console.log('test');
	const optSlickSlidesList = document.querySelectorAll('.slick-slide');
  const optSlickSlidesArr = [...optSlickSlidesList];
  optSlickSlidesArr.forEach(slide => {
		if(!slide.classList.contains('conv-test-66-labels')){
      slide.classList.add('conv-test-66-labels');
      const optFactSheetLinks = slide.querySelector('div[data-autoheight-group="CardSellFactSheets"]');
      const optEmailQuoteBtn = slide.querySelector('button.update-email-data');
      optEmailQuoteBtn.insertAdjacentElement('afterend', optFactSheetLinks);
      const optViewProductBtn = slide.querySelector('a.update-product-state');
      optViewProductBtn.innerHTML = "View Cover";
      const optSlideContainer = slide.querySelector('.card-container__body');
      if(!slide.querySelector('.conv-test-66-labels-container')){ 
      	const optNewLabelsContainer = document.createElement('div');
      	optNewLabelsContainer.classList.add('conv-test-66-labels-container');
        optSlideContainer.prepend(optNewLabelsContainer);
      
        const optProductTitle = slide.querySelector('h3').innerHTML;
        //add extras labels
        if(!optSlideContainer.querySelector('.conv-test-66-labels--extras')){ 
          const optProductTitleArr = optProductTitle.split('and');
          const optExtrasTitle = optProductTitleArr.pop().trim();
          const optExtrasLevelEl = document.createElement('div');
          optExtrasLevelEl.classList.add('conv-test-66-labels--extras');
          let optExtrasLevelText;
          if(optProductTitleArr.length > 0){
            //mix and match product's extra level text
            optExtrasLevelText = optProductsMapObj[optExtrasTitle] ? optProductsMapObj[optExtrasTitle] : "";
          }else{
            //combo product's extra level or extra's only extra level
            optExtrasLevelText = optProductsMapObj[optExtrasTitle.trim()] ? optProductsMapObj[optExtrasTitle.trim()] : "";
          }
          if (optExtrasLevelText !== "" && optExtrasLevelText !== null) {
          	optExtrasLevelEl.innerHTML = optExtrasLevelText;
          	optNewLabelsContainer.prepend(optExtrasLevelEl);
          }
         }
         //add hospital labels
         if(!optSlideContainer.querySelector('.conv-test-66-labels--hospital')){
            const optHospitalLevelEl = document.createElement('div');
            optHospitalLevelEl.classList.add('conv-test-66-labels--hospital');
            const optHospitalLevelText = optProductTitle.match(/\(([^)]+)\)/) !== null ? optProductTitle.match(/\(([^)]+)\)/)[1] : "";
           
            if (optHospitalLevelText !== "" && optHospitalLevelText !== null) {
            	optHospitalLevelEl.innerHTML = optHospitalLevelArr.includes(optHospitalLevelText) ? optHospitalLevelText + " Hospital" : "";
            	optNewLabelsContainer.prepend(optHospitalLevelEl);
            }
          }
        }
   		}
	});
}

window.addEventListener('load', function(){
  //initial label when load
  optAddDynamicLabels();
  optUpdateFrequencyLabels();
  //add labels to dynamic cards
   document.addEventListener('click', function(event){ 
    const optSlickBtnNext = event.target.classList.contains('slick-next') ? event.target : null;    
    if(optSlickBtnNext){
      optAddDynamicLabels();
      optUpdateFrequencyLabels();
    } 
  });
  let touchstartX = 0;
  let touchendX = 0;
  document.addEventListener('touchstart', e => {
    touchstartX = e.changedTouches[0].screenX;
  });
  document.addEventListener('touchend', e => {
    touchendX = e.changedTouches[0].screenX;
    if (touchendX < touchstartX) {
    	optAddDynamicLabels();
      optUpdateFrequencyLabels();
    }
  });
});
