/* Nautilus hero banner variant */
let getStartedUrl = '';
let content = {};
let isDefault = true;

const nautilusHeroBanner = () => {
  const parent = document.querySelector('.nautilus-hero-banner');
  if(!parent){ return; }

  // Exit if utm_term detected
  const params = new Proxy(new URLSearchParams(window.location.search), {
    get: (searchParams, prop) => searchParams.get(prop),
  });
  const value = params.utm_term; 
  if(!value){ 
    content = data.find(e => e.id === "default"); 
  } else {
    if(data.filter(e => e.id === value).length === 0){ 
      content = data.find(e => e.id === "default"); 
    } else { 
      content = data.find(e => e.id === value); 
      isDefault = false;
    }
  }

  // Handle header display
  if(content.sandstoneHeader){
    // Add CSS selector hook
    parent.classList.add('nautilus-transparent-variant');

    // Get get started url
    getStartedUrl = parent.querySelector('.card-body .btn.btn-teal').getAttribute('href');

    if(content.headerBoxClass){
      parent.querySelector('.card-body').classList.add(content.headerBoxClass);
    }

    // Update title
    const title = parent.querySelector('.card-body h1');
    title.innerText = content.title;

    // Update subtitle    
    const subtitle = parent.querySelector('.card-body h4');
    const newSubtitle = document.createElement('h3');
    newSubtitle.innerText = content.subtitle;  
    subtitle.parentNode.insertBefore(newSubtitle, subtitle);
    subtitle.remove();
  } 

  // Add new rate banner
  rateBanner(isDefault);

  // Update buttons
  updateAllButtons();

  // Update step icons
  updateStepsIcon();
  
  // Update disclaimers
  updateDisclaimer();
};

const rateBanner = (isDefault) => {
  const parent = document.querySelector('#nautilus-example').nextSibling.querySelector('section.cta-banner');
  if(!parent){ return; }

  if(isDefault){
    parent.classList.add('nautilus-rate-banner-default');
    return;
  }

  // Create new banner element
  const banner = document.createElement('section');
  const bannerClasses = ['cta-banner', 'regular-section', 'bg-charcoal', 'has-background', 'padding--sm--sm', 'nautilus-rate-banner'];
  banner.classList.add(...bannerClasses);  
  banner.innerHTML = `<div class="container">
<div class="row row-cols-lg-2 row-cols-1">
<div class="col nautilus-rate-banner__col">
<div class="nautilus-rate-banner__title">Low rates starting from:</div>
<div class="nautilus-rate-banner__figure">${content.rate}<span>%</span><sup>^</sup></div>
<div class="nautilus-rate-banner__description">Variable package and comparison rate*</div>
</div>
<div class="col nautilus-rate-banner__col">
<div class="nautilus-rate-banner__title">Example of possible Accelerator home loan savings:</div>
<div class="nautilus-rate-banner__figure">${content.price}<sup>**</sup></div>
<div class="nautilus-rate-banner__description">Apply by 31 December 2022</div>
</div>
</div>
<div class="nautilus-rate-banner__footer">
<a href="${getStartedUrl}" class="btn btn-teal nautilus-btn">Get started</a>
</div>
</div>
`;

  parent.parentNode.insertBefore(banner, parent);
  parent.remove();
};

const updateAllButtons = () => {
  // Get started buttons
  let allButtons = document.querySelectorAll('.btn.btn-teal');
  allButtons.forEach(button => {
    const label = button.innerText.toLowerCase();
    const newClasses = ['btn-teal', 'nautilus-btn'];
    button.classList.add(...newClasses);
    
    // Populate link if is getstarted button
    if(label === "get started"){
     	button.setAttribute('href', getStartedUrl); 
    }

    // Retain default button label if not sandstone banner
    if(button.closest('.nautilus-hero-banner') && !content.sandstoneHeader){ 
      button.classList.add('border-white');
      button.classList.remove('nautilus-btn');
    } else {
      button.innerHTML = 'Get started';
    }
  });

  // Call back buttons
  allButtons = document.querySelectorAll('.btn.btn-teal');
  allButtons.forEach(button => {
    const label = button.innerText.toLowerCase();
    const newClasses = ['btn-teal', 'nautilus-btn'];
    button.classList.add(...newClasses);
    
    // Populate link if is getstarted button
    if(label === "get started"){
     	button.setAttribute('href', getStartedUrl); 
    }

    // Retain default button label if not sandstone banner
    if(button.closest('.nautilus-hero-banner') && !content.sandstoneHeader){ 
      button.classList.remove('btn-outline-primary');
      button.classList.remove('nautilus-btn');
    } else {
      if(!isDefault){
        button.innerHTML = 'Request a call back';  
        button.setAttribute('href', 'https://www.australianunity.com.au/banking/accelerator-home-loan-offer-enquire');
      }      

    }
  });

  // Update sticky nav buttons
  const stickyNavButton = document.querySelector('.wealth__in-page-nav__btn-wrapper .btn.btn-primary');
  stickyNavButton.classList.remove('btn-primary');
  stickyNavButton.classList.add('btn-teal');
  if(isDefault){
    stickyNavButton.innerHTML = 'Request a call back';  
    stickyNavButton.setAttribute('href', 'https://www.australianunity.com.au/banking/accelerator-home-loan-offer-enquire'); 
  } else {  
    stickyNavButton.innerHTML = 'Get started';
    stickyNavButton.setAttribute('href', getStartedUrl);    
  }
};

const updateStepsIcon = () =>{
  const steps = document.querySelectorAll('.nautilus-step-icon');
  if(!steps){ return; }

  steps.forEach(step => {
    step.classList.remove('icon');
  });  
};

const swapDisclaimer = (dis, data) => {
  if(!dis){ return; }
  if(!data || data === ''){ return; }      
  console.log(dis, data);
  dis.innerHTML = data; 
};

const updateDisclaimer = () => {
  const disclaimer1 =  document.querySelector('.nautilus-disclaimer-1');
  swapDisclaimer(disclaimer1, content.disclaimer1);
  const disclaimer2 =  document.querySelector('.nautilus-disclaimer-2');
  swapDisclaimer(disclaimer2, content.disclaimer2);	
  const disclaimer3 =  document.querySelector('.nautilus-disclaimer-3');
  swapDisclaimer(disclaimer3, content.disclaimer3);
};

if (document.readyState !== 'loading') {
  nautilusHeroBanner();
} else {
  document.addEventListener('DOMContentLoaded', function () {
    nautilusHeroBanner();
  });
}
