    disclaimer2: ' **The Accelerator home loan offer interest savings and total benefits example has been modelled on a variable interest rate lending scenario borrowing amount of $750,000, with a .20% p.a loyalty reward discount applied to a 20 year P&I home loan with ≤70% Loan to Value Ratio (LVR).<br/><br/>In modelling the example savings, we have assumed that there have been no future interest rate changes, the term and frequency of repayments are unchanged, all repayments are made on time with no redraws or credit limit increases.<br/><br/>It is an example only as every borrower\'s situation is different and may not reflect your actual savings as many factors may affect the cost of your loan. You will need to access the Accelerator home loan quick start application to obtain an estimate of your particular savings and total benefits applicable to your circumstances.<br/><br/>You should not rely only on this information for the purposes of deciding to refinance your current loan with Australian Unity Bank. This calculation does not take into account your personal needs and financial circumstances and you should consider whether it is appropriate for you.<br/><br/>',
