// Update steps button label
const updateStepsButton = () => {
  const button = document.querySelector('.steps .update-product-state.btn');
  if(!button) { return; }
  button.innerText = 'Join within 5 minutes';  

  const stickyButton = document.querySelector('.steps__submit--sticky .update-product-state.btn');
  if(!stickyButton) { return; }  
  stickyButton.innerText = 'Join within 5 minutes';  
  
  const priceBox = document.querySelectorAll('.js-product-page.price-box');  
  if(priceBox.length < 1){ return; }
  priceBox.forEach(pb => {
    const button = pb.querySelector('.btn.update-product-state');
    button.innerText = 'Join within 5 minutes';  
  });
};

const initAll = () => {
  initTest71();
  updateStepsButton();
  addDiscountLabel();
};

if (document.readyState !== 'loading') {
  initAll();
} else {
  document.addEventListener('DOMContentLoaded', function () {
    initAll();
  });
}
